import Paper from "@material-ui/core/Paper";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";

import "/styles/form.scss";

export default function Form() {
  return (
    <section className="Form">
      <Paper>
        <AccountCircleIcon />
      </Paper>
    </section>
  );
}
